import SideNavBar from "../Components/SideNavBar";
import NavBar from "../Components/NavBar";
import Box from "@mui/material/Box";
import Book from "./Book";

function Books() {
  let obj =[ {
    Name: "you can do it",
    Author: "xyz",
    Publisher: "abc",
    Avability: "No",
    Ledger: "dew",
  },
  {
    Name: "The monk who sold his car",
    Author: "xyz",
    Publisher: "abc",
    Avability: "No",
    Ledger: "dew",
  },
  {
    Name: "",
    Author: "xyz",
    Publisher: "abc",
    Avability: "No",
    Ledger: "dew",
  },
  {
    Name: "you can do it",
    Author: "xyz",
    Publisher: "abc",
    Avability: "No",
    Ledger: "dew",
  },
]
  return (
    <>
      <NavBar />
      <Box height={30} />
      <Box sx={{ display: "flex" }}>
        <SideNavBar />

        <Box component="main" sx={{ flexGrow: 1, p: 3 }}>
          <h1>Books</h1>

         {
          obj.map(book=> <Book
            Name="you can do it"
            Author="xyz"
            Publisher="abc"
            Avability="No"
            Ledger="dew"
          />)
         }

          {/* <Book {...obj}/>
          <Book
            Name="The mnk who sold his car"
            Author="xyz"
            Publisher="abc"
            Avability="No"
            Ledger="dew"
          />
          <Book
            Name="you can do it"
            Author="xyz"
            Publisher="abc"
            Avability="No"
            Ledger="dew"
          /> */}
         
        </Box>
      </Box>
    </>
  );
}
export default Books;
